    <div className="input-section">
      <h1>INPUT SECTION</h1>
      <InputSelectionButton />
      <InputSelectionButton />
      <InputSelectionButton />
      <InputSelectionButton />
      <InputSelectionButton />
      <SelectedInput />
    </div>
  );
}
